import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { adminProfile } from '../../actions/adminActions';

const BlackListed = () => {

    const dispatch = useDispatch();
    const adminProfileDetails = useSelector((state) => state.adminProfile)
    
    const {data} = adminProfileDetails

    console.log(data);
    useEffect(() => {
        dispatch(adminProfile())
    }, [])

  return (
    <div>
        <div className="blacklist-main">
        {data ? data?.adminData?.adminData?.blacklistedUsers.map  : 'sd'}

        </div>
    </div>
  )
}

export default BlackListed
